import { useState } from 'react';
import Navbar from './components/Home/Navbar/Navbar';
import PreviewCards from './components/Home/PreviewCards/PreviewCards';
import Map from './components/Home/Map/Map';


function App() {
  return (
    <>
    <Navbar/>
    <section className='mainpage'>
      <section className='leftside'>
        <PreviewCards/>
      </section>
      <section className='rightside'>
      <div style={{ width: "100vw", height: "100vh" }}>
      <MapWrapped
        googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyCZCT3bmiMcc3TcYVE1UQTbf3suEJmgpa4`}
        loadingElement={<div style={{ height: `100%` }} />}
        containerElement={<div style={{ height: `100%` }} />}
        mapElement={<div style={{ height: `100%` }} />}
      />
    </div>
      </section>
    </section>
    </>
  );
}

export default App;
